  `receive_isHomeDelivery` int NULL DEFAULT 0 COMMENT '是否送货上门，1：是；0：否',
  `remark_customer` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '用户的备注信息',
  `preorder_time` datetime NULL DEFAULT NULL COMMENT '预订时间，预订类型才有',
  `preorder_minPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '预订批次最小单价',
  `preorder_maxPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '预订批次最大单价',
  `preorder_startSelling_time` datetime NULL DEFAULT NULL COMMENT '预订批次开始售卖的时间',
  `preorder_startSelling_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '预订批次开始售卖的操作人',
  `preorder_finalPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '预订批次最终单价',
  `stock_unitPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '现货批次单价',
  `discountAmount_promotion` decimal(10, 2) NULL DEFAULT NULL COMMENT '满减的优惠金额',
  `extraOptions` json NULL COMMENT '额外选项',
  `postage` decimal(10, 2) NOT NULL COMMENT '邮费',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '订单状态',
  `cancel_reason` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '取消原因',
  `cancel_time` datetime NULL DEFAULT NULL COMMENT '取消时间',
  `cancel_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '由谁取消',
  `pay_time` datetime NULL DEFAULT NULL COMMENT '付款时间',
  `pay_finalAmount` decimal(10, 2) NULL DEFAULT NULL COMMENT '客户最终付款的金额',
  `ship_trackingNumber` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '发货填写的快递单号',
  `ship_time` datetime NULL DEFAULT NULL COMMENT '发货时间',
  `ship_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '发货填写人',
  `complete_time` datetime NULL DEFAULT NULL COMMENT '订单完结时间（即交易成功的订单，取消的订单不算完结）',
  `complete_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '订单由谁完结（手机号，与user相等则表示是客户自己完结）',
  `remark_self` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '己方备注',
  `snapshot_coverImage` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '商品快照 封面图',
  `snapshot_goodsName` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '商品快照',
  `snapshot_goodsUnit` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '商品快照',
  `snapshot_goodsRemark` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '商品快照',
  `snapshot_goodsRichText` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '商品快照',
  `snapshot_discounts` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '优惠策略，JSON格式的数组对象',
  `createTime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updateTime` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_batch_status`(`batch_no` ASC, `status` ASC) USING BTREE,
  INDEX `batch_no`(`batch_no` ASC) USING BTREE,
  INDEX `order_no`(`order_no` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 131 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = DYNAMIC;

